	add("coadjutor", "{\"term\":\"coadjutor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027coadjuteur\u0027 from Latin {{m|la|coadiūtor}}, from \u0027\u0027 + {{m|la|adiūtor||helper}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An assistant or helper\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1891\u0027\u0027, Mary Noailles Murfree, \u0027In the \u0026quot;Stranger People\u0027s\u0026quot; Country\u0027, Nebraska 2005, pp. 206-7\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The mountaineer, with all his pulses aquiver, looked down into his \u0027\u0027coadjutor\u0027\u0027’s white, startled face\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An assistant to a bishop\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1842\u0027\u0027 John Henry Newman - The Ecclesiastical History of M. L\u0027abbé Fleury\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"When old age rendered any Bishop unable to perform his duties, the first example of which occurs AD 211, when Alexander became \u0027\u0027coadjutor\u0027\u0027 to Narcissus at Jerusale\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027 James Martin Estes - Peace, Order and the Glory of God\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"August then appointed Prince George III of Anhalt (who was both a theologian and a priest as well as a prince) to be his \u0027\u0027coadjutor\u0027\u0027 in spiritual matters\", \"priority\":8}]}, \"synonyms\":{}}");

