	add("coalition", "{\"term\":\"coalition\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027coalition\u0027 (coalition) from \u0027alo\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A temporary group or union of organizations, usually formed for a particular advantage\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The Liberal Democrats and Conservative parties formed a \u0027\u0027coalition\u0027\u0027 government in 2010\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027 May 23, w:Sarah Sarah Lyall, \u0026quot;[http://www.nytimes.com/2013/05/24/world/europe/british-leader-david-cameron-faces-rebellion-in-his-party.html?pagewanted\u003dall\u0026amp;_r\u003d0 British Leader’s Liberal Turn Sets Off a Rebellion in His Party],\u0026quot; \u0027New York Times\u0027 \u0026lt;small\u0026gt;(retrieved 29 May 2013)\u0026lt;/small\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"At a time when Mr. Cameron is being squeezed from both sides — from the right by members of his own party and by the anti-immigrant, anti-Europe U.K. Independence Party, and from the left by his Liberal Democrat \u0027\u0027coalition\u0027\u0027 partners — the move seemed uncharacteristically clunky\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027 August 7, Joshi Herrmann, \u0026quot;[http://www.standard.co.uk/lifestyle/london-life/how-cricket-netted-the-hipsters-8749429.html How cricket netted the hipsters]\u0026quot;, \u0027London Evening Standard\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Sometimes the ante is upped, the gaggle of bowlers all working on their batsman in turn, like a \u0027\u0027coalition\u0027\u0027 of cheetahs singling out a vulnerable gazelle, sending their distinctive balls down until the pressure forces a mistake or the batsman gets his own back by smashing a bad ball over everyone’s heads\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027 September 6, Darren Boyle, \u0026quot;[http://www.dailymail.co.uk/news/article-2755340/Running-wild-Mother-cheetah-SIX-cubs-keeping-busy-jumping-hiding-climbing-her.html Running wild! Mother cheetah has SIX cubs keeping her busy by jumping, hiding and climbing all over her]\u0026quot;, \u0027The Daily Mail\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Majed Sultan Ali was on his second visit to the game reserve in a bid to photograph a \u0027\u0027coalition\u0027\u0027 of cheetahs\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2015\u0027\u0027 June 11, \u0026quot;[http://www.bristolpost.co.uk/moment-ostrich-attempts-outrun-cheetahs-Sir-David/story-26679053-detail/story.html This is the moment an ostrich attempts to outrun cheetahs in Sir David Attenborough\u0027s latest show]\u0026quot;, \u0027Bristol Post\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"This is the incredible moment a juvenile ostrich attempts to outrun a \u0027\u0027coalition\u0027\u0027 of cheetahs that forms a central part of the latest BBC programme to be presented by Sir David Attenborough\", \"priority\":10}]}, \"synonyms\":{}}");

