	add("coaming", "{\"term\":\"coaming\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"On a boat, the vertical side of above-deck structures, such as the coach roof, hatch, and cockpit\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A raised frame, designed to deflect or prevent entry of water, around an opening (e.g., a hatch or skylight) in a flat surface, such as a roof or deck\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1979\u0027\u0027, Cormac McCarthy, \u0027Suttree\u0027, Random House, p.92\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Creepers threaded the wrecked windows of the coaches, ancient and chalky brown with their riveted seams and welted \u0027\u0027coamings\u0027\u0027 like something proofed for descents into the sea\", \"priority\":4}]}, \"synonyms\":{}}");

