	add("coast", "{\"term\":\"coast\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) and Old french (842-ca. 1400) \u0027coste\u0027 from Latin {{m|la|costa||edge}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The side or edge of something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The edge of the land where it meets an ocean, sea, gulf, bay, or large lake\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The rocky \u0027\u0027coast\u0027\u0027 of Maine has few beaches\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A region of land; a district or country\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1526\u0027\u0027, \u0027Bible\u0027, tr. William Tyndale, Matthew 2\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Then Herod perceavynge that he was moocked off the wyse men, was excedynge wroth, and sent forth and slue all the chyldren that were in bethleem, and in all the \u0027\u0027costes\u0027\u0027 thereof\u0026amp;nbsp;[…\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"II.ii.3\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"P. Crescentius, in his \u0027lib.\u0027 1 \u0027de agric. cap.\u0027 5, is very copious in this subject, how a house should be wholesomely sited, in a good \u0027\u0027coast\u0027\u0027, good air, wind, etc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A region of the air or heavens\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1590\u0027\u0027, Edmund Spenser, \u0027The Faerie Queene\u0027, III.iii\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"the learned Merlin, well could tell, / Vnder what \u0027\u0027coast\u0027\u0027 of heauen the man did dwell\u0026amp;nbsp;[…\", \"priority\":11}]}, \"synonyms\":{}}");

