	add("coasteering", "{\"term\":\"coasteering\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|coast|mountaineering|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hybrid sport involving the traversal of a coastline without mechanical aids, usually by some mixture of jumping, walking, climbing and swimming\", \"priority\":1}]}, \"synonyms\":{}}");

	add("coaster", "{\"term\":\"coaster\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{-er|coast}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"one who coasts\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Something that coasts, such as a sled or toboggan\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A merchant vessel that stays in coastal waters\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A sailor who travels only in coastal waters\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1881\u0027\u0027, \u0027Symon\u0027s monthly meteorological magazine\u0027 (page 59\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"If you question a seaman on the subject, whether mere \u0027\u0027coaster\u0027\u0027 or circumnavigator, he will tell you that in a snow-storm, because of its constant eddyings and gyrations, frequent trimming of sails is more necessary than in any other gal\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A person who originates from or inhabits a coastal area\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A small piece of material used to protect the surface of a table, upon which one places cups or mugs\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A small tray on wheels, used to pass something around a table\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A worthless compact disc or DVD, such as one that was burned incorrectly\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A rollercoaster\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A (brook trout, \u0027Salvelinus fontinalis\", \"priority\":12}]}, \"synonyms\":{}}");

	add("coasterware", "{\"term\":\"coasterware\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|coaster|ware|lang\u003den}}, from the jocular notion that the disc containing the software is more useful as a drink coaster.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Exceptionally low-quality software\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, \u0026quot;[http://www.accessmylibrary.com/article-1G1-108041765/europa-universalis-crown-north.html Europa Universalis: Crown of the North]\u0026quot;, \u0027Computer Gaming World\u0027, 1 November 2003\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"From start to finish, it is a poorly conceived, ill-executed, and time-wasting piece of \u0027\u0027coasterware\u0027\u0027 designed to suck money away from both fans of the much-lauded series and unsuspecting newcomers\", \"priority\":3}]}, \"synonyms\":{}}");

	add("coath", "{\"term\":\"coath\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027cothe\u0027 from Old english (ca. 450-1100) {{m|ang|coþu||disease, sickness, pestilence}}, from Proto-germanic {{m|gem-pro|*kuþō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Sickness; disease; pestilence\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An attack of illness, such as swooning, pangs of childbirth, etc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A disease affecting sheep or cattle\", \"priority\":3}]}, \"synonyms\":{}}");

	add("coati", "{\"term\":\"coati\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"tupí\"], \"text\":\"From Tupí\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several omnivorous mammals, of the genus \u0027Nasua\u0027, in order Carnivora, that live in the range from southern United States to northern Argentina\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1974\u0027\u0027, Bil Gilbert, \u0026quot;Chulo\u0026quot;, \u0027\u0027, %22coatis%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003d5sRMsiQyo8\u0026amp;sig\u003dMzmYAxheNFtBGaknG_cetgiKP5U\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dCCFUUJjtMcWgiQe6noDoCA\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"%22coatis%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 89\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Prospectors and cowpunchers who see the animals most often, sometimes call them Mexican monkeys. Others believe the \u0027\u0027coati\u0027\u0027 to be a peculiar kind of arboreal anteater. More generally in this region, \u0027\u0027coatis\u0027\u0027 are called “chulo bears” or simply “chulos,” and will be so referred to hereafter\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Maurice Burton, Robert Burton, \u0027\u0027\u0027Coati\u0027\u0027\u0027, \u0027International Wildlife Encyclopedia: Chickaree - crabs\u0027, %22coatis%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003d9Day7HtlFa\u0026amp;sig\u003dIYgb7d0jVNG_pS6yz2sCMFjeUuw\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dCCFUUJjtMcWgiQe6noDoCA\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"%22coatis%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 478\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027coatis\u0027\u0027 are four small, carnivorous mammals related to the raccoon, red panda and ringtail, or cacomistle. They range in size from 15 inches (38 cm) in the mountain coati, \u0027Nasuella olivacca\u0027, to 16-26 inches (41-67 cm) long in the three species \u0027Nasua nasua\u0027, \u0027N. nelsoni\u0027 and \u0027N. narica\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Hope B. Werness, \u0027The Continuum Encyclopedia of Animal Symbolism in Art\u0027, %22coatis%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003delHfYCxBKG\u0026amp;sig\u003dzfGO8OJH0A7GimHan-zoseRQdf4\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dCCFUUJjtMcWgiQe6noDoCA\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"%22coatis%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 88\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Above: Maya effigy vessel depicting a red \u0027\u0027coati\u0027\u0027 or opposum with some anthropomorphic traits\", \"priority\":10}]}, \"synonyms\":{}}");

	add("coatdress", "{\"term\":\"coatdress\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|coat|dress|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A dress that resembles a coat, usually having a buttoning fron\", \"priority\":1}]}, \"synonyms\":{}}");

	add("coatee", "{\"term\":\"coatee\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A coat with short flap\", \"priority\":1}]}, \"synonyms\":{}}");

	add("coating", "{\"term\":\"coating\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A thin outer layer\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"They painted on a \u0027\u0027coating\u0027\u0027 to protect it from the weather\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Cloth for making coats\", \"priority\":3}]}, \"synonyms\":{}}");

	add("coattail", "{\"term\":\"coattail\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|coat|tail|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The flap at the back of a coat that hangs down, sometimes below the waist\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"At twilight in the summerthe mice come out. Theyeat the luncheon crumbs. Mr. Checkly, for instance, always brought his dinner in a paper parcel in his \u0027\u0027coat-tail\u0027\u0027 pocket, and ate it when so disposed, sprinkling crumbs lavishlyon the floor\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Success of a figure, organization or movement that transfers to those who associate with it\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, The Economist, Oct 6th 2012; [http://www.economist.com/node/21564240 The Senate: Not so flippable\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Mr Obama’s \u0027\u0027coat-tails\u0027\u0027 may help lift Wall-Street-basher Elizabeth Warren past pickup-driving Everyman and one-time nude pin-up Scott Brown in Massachusetts\", \"priority\":5}]}, \"synonyms\":{}}");

	add("coaugmentation", "{\"term\":\"coaugmentation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|co|augmentation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A natural transformation from the identity functor to a certain endofunctor\", \"priority\":1}]}, \"synonyms\":{}}");

